   "source": [
    "# Plot with options\n",
    "plot(iris$Petal.Length, iris$Petal.Width,\n",
    "  col = \"#cc0000\",  # Hex code for datalab.cc red\n",
    "  pch = 19,         # Use solid circles for points\n",
    "  main = \"Iris: Petal Length vs. Petal Width\",\n",
    "  xlab = \"Petal Length\",\n",
    "  ylab = \"Petal Width\")\n",
    "\n",
    "# PLOT FORMULAS WITH PLOT() ################################\n",
    "\n",
    "plot(cos, 0, 2*pi)\n",
    "plot(exp, 1, 5)\n",
    "plot(dnorm, -3, +3)\n",
    "\n",
    "# Formula plot with options\n",
    "plot(dnorm, -3, +3,\n",
    "  col = \"#cc0000\",\n",
    "  lwd = 5,\n",
